.header {
  min-height: 340px;
  position: relative;
  background: url(/landing/img/BackgroundFAQs.jpg) no-repeat;
  background-size: cover;
  .container {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    display: flex;
    flex-direction: column;
    text-align: center;
    justify-items: center;
  }

  .title {
    font-size: 1.75rem;
  }
}

.content {
  padding: 30px;
  .row {
    display: flex;
    flex-wrap: wrap;
  }

  .col-4 {
    flex: 0 0 30.33333%;
    max-width: 30.33333%;
    margin-right: 2%;
    margin-top: 30px;
  }

  @media screen and (max-width: 600px) {
      .col-4 {
        flex: 0 0 100%;
        max-width: 100%;
        margin-right: 2%;
        margin-top: 30px;
      }
  }

  .item {
    .title {
      color: #fff;
      font-size: 20px;
      font-weight: 700;
      border-bottom: 1px solid;
      border-color: #fff;
    }

    li {
      border-bottom: 1px dashed #fff;
      padding: .5rem 0;
      cursor: pointer;
    }
  }
}

.detail {
  .title {
    font-size: 1.5rem;
    font-weight: bold;
  }

